import styled from "styled-components";
export const ContentBlock = styled.div`
  width: 100%;
  height: 85vh;
  display: flex;
  position: relative;
`;

export const ContentItem = styled.section`
  width: 90%;
  height: 85vh;
  background-color:red;
`;
